import React from "react";
import { MDBContainer, MDBRow, MDBCol } from "mdbreact";
import './inin.css';
import './AdminDash.css';
import SideBar from './SideNav';
import student from '../assets/student.png';
import teacher from '../assets/professor.png';
import parent from '../assets/family.png';
import schedule from '../assets/calendar.png';
const gridExamplesPage = () => {
  return (
      <div>
           <SideBar />
          <MDBContainer>
      <MDBRow>
        <MDBCol></MDBCol>
        <MDBCol>col</MDBCol>
        <MDBCol>col</MDBCol>
        <MDBCol>col</MDBCol>
      </MDBRow>
      <MDBRow>
        <MDBCol size="8">col-8</MDBCol>
        <MDBCol size="4">col-4</MDBCol>
      </MDBRow>
    </MDBContainer>
      </div>
    
  );
}

export default gridExamplesPage;
